css:
@-moz-document url-prefix("http://www.ics.uci.edu/~thornton/") {
body {
    background-color: #1a1b20;
    color: #bdbdbd;
}
div.header P {
    color: #5BD2CD;
}
hr {
    background-color: #bdbdbd;
}
div.section p.title {
    color: #5BD2CD;
}
div.section p.subtitle {
    color: #5BD2CD;
}
a:link {
    color: #71F59A;
}
a:visited {
    color: #e0e508;
}
div.navbar p {
    color: #bdbdbd;
}
}
